import styled from "styled-components";


function PlaylistEntry(props){


    const artistLabels = props.artists.map((artist, i)=>{
        return <a href = {artist.artistUrl} target = "_blank" >{artist.artistName}</a>
    });

    return (
        <Parent>
            <ArtistLablesParent>
                {artistLabels}
            </ArtistLablesParent>

            <h1>playlist</h1>
            <ul>
                <Li>
                    <a href={props.imageUrl}>image url</a>
                </Li>
                <Li>
                    <a href={props.playlistUrl}>playlist url</a>
                </Li>
                <Li color="green">
                    <p>{JSON.stringify(props.artists)}</p>
                </Li>
            </ul>
        </Parent>

    )
}

const Parent = styled.div`
position: relative;
margin: 1rem;
`

const ArtistLablesParent = styled.div`
position: absolute;
        max-width: 100%;
        display: flex;
        left: 0;
        top: 0;
        flex-wrap: wrap;
        opacity: 0;
        transition: 0.3s;
`

const Li = styled.li`
    color: blue;
    background: ${props=>props.color || "red"};
`

export default PlaylistEntry;
